  constructor(props){
    super(props)

    this.state={
      title: '',
      date: '',
      learned: '',
      unsure: '',
      goals_accomplished: '',
      goals_tomorrow: '',
      mood: ''
    }
  }


  render(){
    return(
      <div className="ui form">
        <form onSubmit={(event) => this.handleOnSubmit(event)}>
          <div className="seven fields">
            <div className="field">
              <label>Title:</label>

            </div>
          </div>
        </form>
      </div>
    )
  }
}

